    # Text+Code prompts
    ("To implement a basic encryption algorithm in Python, one could use the Caesar cipher technique, which is a type of substitution cipher where each letter in the plaintext is shifted a certain number of places down or up the alphabet. Here is a simple implementation: def caesar_cipher(text, shift): encrypted_text = '' for char in text: if char.isalpha(): shift_amount = shift % 26 new_char = chr((ord(char) + shift_amount - 65) % 26 + 65) if char.islower(): new_char = new_char.lower() encrypted_text += new_char else: encrypted_text += char return encrypted_text", "Code"),
    ("Understanding how databases work is essential for backend development. SQL, or Structured Query Language, is used to communicate with a database. Here's a basic SQL command to create a table named 'students' with columns for the student ID, name, and grade level: CREATE TABLE students (id INT AUTO_INCREMENT PRIMARY KEY, name VARCHAR(100), grade INT); // This SQL statement creates a new table with three columns: id, name, and grade. The id column is set to auto-increment and serve as the primary key.", "Code"),

    # Adding more diverse prompts
    ("The French Revolution, which began in 1789, was a period of radical social and political upheaval in France that fundamentally changed the course of French history. The motto 'Liberté, égalité, fraternité', or 'Liberty, equality, fraternity', encapsulates the values of the Revolution. This era saw the rise of figures like Maximilien Robespierre and the implementation of the Reign of Terror, but also laid the groundwork for modern democratic institutions.", "No code"),
