    ("When designing a website, it's important to consider user experience and accessibility. A well-designed website ensures that users of all abilities can navigate and interact with the content effectively. This includes clear navigation menus, responsive design for various devices, and the use of ARIA (Accessible Rich Internet Applications) labels for assistive technologies.", "No code"),
    ("To sort an array in Java, one can utilize the Arrays.sort() method from the java.util package. Here's how you can apply it: import java.util.Arrays; public class Main { public static void main(String[] args) { int[] numbers = {9, 5, 1, 4, 3}; Arrays.sort(numbers); System.out.println(Arrays.toString(numbers)); } } // This code snippet demonstrates sorting an integer array in ascending order using the Arrays.sort() method.", "Code"),
    ("The concept of evolution by natural selection, first proposed by Charles Darwin in the 19th century, provides a scientific explanation for the diversity of life on Earth. Through the process of natural selection, traits that enhance survival and reproduction become more common in the population over time. This concept is a cornerstone of modern biology, explaining the complexity and diversity of life forms.", "No code"),
    # Adding a few more to complete the list
    ("In the realm of computer science, recursion is a method of solving a problem where the solution depends on solutions to smaller instances of the same problem. Here's a simple example in Python that calculates the factorial of a number: def factorial(n): if n == 1: return 1 else: return n * factorial(n-1) // This recursive function demonstrates how a function can call itself to perform a task, in this case, calculating the factorial of a number.", "Code"),
    ("Climate change is one of the most pressing issues facing the global community today. It refers to significant changes in global temperatures and weather patterns over time. While climate change is a natural phenomenon, scientific evidence shows that human activities, particularly greenhouse gas emissions from burning fossil fuels, are significantly contributing to unprecedented changes in the Earth's climate. This complex issue affects every corner of the globe, impacting weather patterns, sea levels, and biodiversity.", "No code"),
    ("HTML stands for HyperText Markup Language. It is the standard markup language for documents designed to be displayed in a web browser. It can be assisted by technologies such as Cascading Style Sheets (CSS) and scripting languages such as JavaScript. Here is a simple HTML document: <!DOCTYPE html> <html> <head> <title>Page Title</title> </head> <body> <h1>My First Heading</h1> <p>My first paragraph.</p> </body> </html> // This example demonstrates the basic structure of an HTML document, including the use of doctype, html, head, and body tags.", "Code"),
    ("The Industrial Revolution was a period of major industrialization that took place during the late 1700s and early 1800s. The Industrial Revolution began in Great Britain and quickly spread throughout the world. This transformative period was characterized by the transition from hand production methods to machines, new chemical manufacturing and iron production processes, improved efficiency of water power, the increasing use of steam power, and the development of machine tools. It marked a major turning point in history; almost every aspect of daily life was influenced in some way.", "No code"),
