    ('Two new travel sets - Aging and Sensitive - by Doctor D. Schwab are now available.\nSan Diego, CA (1888PressRelease) March 08, 2011 - The Doctor D. Schwab product line has debuted two new travel sets which are not only great for travel, they are also great as an introduction to the line. The Skin Care Essentials Travel Set is great for all skin types, and the Sensitive Skin Travel Set is good for sensitive skin types. For oily and blemished skin, the Adios Pimples three step regimen set is available.\nThe Skin Care Essentials Travel Set is great for all skin types. Cleanse skin with Herbal Foam Cleanser, tone with Herbal Toner, exfoliate with Bamboo Cream Peel, and moisturize with Cell Renewal Day Cream.\nHerbal Foam Cleanser, 1 fl.oz.\nHerbal Toner, 1 fl.oz.\nBamboo Cream Peel, 0.25 fl.oz.\nCell Renewal Day Cream, 0.25 fl.oz.\nHerbal Foam Cleanser is a gentle foaming cleanser with anti-irritants that leaves skin feeling soft and refreshed. Coconut Oil, Thyme Extract, and Rosemary Extracts leave skin soft and moist, while Calendula Extract helps to improve skin texture.\nHerbal Toner contains a refreshing blend of active botanicals including extracts of Rosemary, Hops, and Hamamelis which revitalize pores and keep the skin pH balanced. Lemon Bioflavonoids help to reduce blotchiness, Citric Acid refreshes and Vitamin E and Aloe hydrate.\nBamboo Cream Peel is a gentle, non-irritating skin smoother with natural bamboo, jojoba beads and crushed almonds. Exfoliates dead surface skin cells for soft, silky skin and a more radiant complexion.\nCell Renewal Day Cream is a lightweight daytime moisturizer with powerful free-radical exchangers. Borage Seed Oil, Sodium Hyaluronate and ceramides help to heal damaged skin and improve skin texture. Olive Leaf Extract and Grapeseed Extract hydrate and soften skin.\nThe Sensitive Skin Travel Set is a great solution for sensitive skin types. Cleanse skin with Sensitive Cleanser, tone with Herbal Toner, revitalize with Ginkgo Mask, and moisturize with Sensitive Moisturizer.\nSensitive Cleanser, 1 fl.oz.\nSensitive Moisturizer, 0.25 fl.oz.\nGinkgo Mask, 0.25 fl.oz.\nSensitive Cleanser is a balanced, bio-active skin cleanser that thoroughly cleanses and moisturizes without irritation. Aloe, Eucalyptus and soothing extracts provide gentle yet effective removal of oils and residue. The mild, all-natural Orange scent refreshes and reinvigorates.\nSensitive Moisturizer is an emollient-rich formula especially for sensitive, cracked, irritated skin which craves ultra hydration and protection to soothe and calm inflammation. With natural butters to soften and high potency anti-oxidant Vitamin E.\nGinkgo Mask contains a revitalizing blend of vitamins, minerals, plant extracts and Ginkgo Biloba Bioflavonoids with powerful free radical scavenging abilities to brighten skin and restore moisture, resulting in skin that is refreshed, smooth and moist.\nDoctor D. Schwab products help to correct a range of skin problems, maintain youthful looking skin, and work to prevent further damage. A blend of natural vitamins, herbal extracts, and botanical infusions provide exceptional results by revitalizing and regenerating. Powerful free radical exchangers enhance skin moisture and encourage the proliferation of new, healthy cells.\nDoctor D. Schwab products are developed and manufactured by CA BOTANA, headquartered in San Diego, CA. For over 40 years, CA BOTANA has studied the effects of sea extracts, plants, herbs and vitamins, integrating breakthrough discoveries with the latest skin care technology. For more information about CA BOTANA or Doctor D. Schwab products, visit the website at www.ca-botana.com or www.doctorschwabca.com call |||PHONE_NUMBER||| .', "No code"),
