    ('Lynedene is an impressive detached home which has been much improved and extended by the current owners set on the edge of the Town Centre.\nWith its great versatility of space this is the perfect home for a growing family, those who work from home or just love to entertain.\nReception Hall, Lounge, Dining Room, Family Room, stunning open plan Living/Dining/Kitchen, Utility and Cloakroom. Principal Bedroom with Balcony providing fabulous open views over adjoining countryside, 3 further double Bedrooms and family Bathroom.\nSet in a large plot with extensive gardens, large Garage/Workshop and ample parking.\nThe perfect live, work play home which has been extensively improved to provide flexibility for today\'s modern lifestyle. Extended to the rear is the fabulous open plan Living/Dining/Kitchen which has been beautifully fitted and benefits from full width bi-fold doors which lead onto the rear garden ideal for those who love to dine alfresco and above is the impressive Principal Bedroom suite which has a large Dressing area and French doors opening onto the Balcony which provides fabulous views over the gardens and adjoining farmland across to the Shropshire Hills. The Bathroom and en suite have both been re-fitted with contemporary suites with drench head showers.\nExternally the driveway provides parking and hardstanding for numerous vehicles and there is a large detached Garage/Workshop.\nThe property occupies an enviable semi rural location right on the edge of the Town perfect for commuters with ease of access to the A5/M54 motorway network. There are excellent facilities on hand at nearby Radbrook including supermarket, shops, doctors, schools, public house and takeaways and a short distance from the Town Centre.\nWooden and glazed entrance door opens to Reception Hall with window to the front, tiled floor, radiator.\n3.86m x 3.63m (12\'8" x 11\'11")with window to the front, chimney breast with recess for fire, radiator.\n4.85m x 4.27m (15\'11" x 14\'0")A lovely light room with windows to the front and side. Chimney breast housing cast iron log burner, media point, radiator.\n3.96m x 2.90m (13\'0" x 9\'6")A great multi purpose room with window to the side, radiator.\n5.56m x 5.54m (18\'3" x 18\'2")Beautifully fitted and naturally well lit with windows to the side and bi-folds opening onto the rear garden. The Kitchen has been comprehensively fitted with modern range of French navy shaker style units incorporating inset sink with mixer taps set into base cupboard. Further range of cupboards and drawers with granite work surfaces over and having integrated dishwasher, washing machine, full height fridge and freezer all with matching facia panels. Double opening doors to fabulous shelved larder unit and matching range of eye level wall units. Range cooker with extractor hood over and impressive breakfast island with ample workspace and seating area - perfect for those budding chef\'s. The Dining/Family area features full width bi-fold doors which open onto the rear garden and sun terrace. Recessed ceiling lights, tiled flooring.\nWith suite comprising low flush WC and wash hand basin, radiator.\n6.15m x 3.38m (20\'2" x 11\'1)An excellent sized room is naturally well lit with window to the side and double opening French doors leading onto a Sun Balcony with wrought iron balustrading from which are the most stunning views over adjoining countryside to Shropshire Hills in the distance. Range of fitted wardrobes, recessed ceiling lights, radiator.\n2.36m x 1.40m (7\'9" x 4\'7")Recently re-fitted with contemporary suite comprising large walk in shower cubicle with direct mixer shower with drench head, wash hand basin set into vanity unit with storage, WC suite. Fully tiled walls and flooring, heated towel rail/radiator, window to the side with lovely outlooks over adjoining farmland.\n2.59m x 4.24m (8\'6" x 13\'11)With window to the front with fabulous open aspect over open countryside, radiator.\n2.59m x 3.68m (8\'6" x 12\'1")Again with window to the front with fabulous open views, radiator.\n2.11m x 3.43m (6\'11" x 11\'3)With window to the rear with views over open fields and Shropshire Hills in the distance. Wardrobe recess with hanging rail and shelving, radiator.\n2.08m x 1.85m (6\'10" x 6\'1")Recently re-fitted with P-shaped bath with direct mixer shower unit with drench head over, wash hand basin and WC suite. Complementary fully tiled walls and flooring, window to the side, heated towel rail/radiator.\nThe property has a long gravelled driveway with double opening wooden gates and provides parking and hardstanding for numerous vehicles and leads to the Detached Garage with up and over door, power and lighting and being of a double Garage style with wash basin and WC to the side.\nThe Gardens are a particular feature of the property, being of a good size and laid extensively to several lawned areas with flower and shrub beds and one section enclosed with laurel hedging. To the rear of the Garage is a screened play area and immediately adjacent to the Living/Dining/Kitchen is a good sized paved sun terrace, perfect for dining alfresco with an additional lawed area. The property is bordered to the side and rear by open farmland with lovely open aspects. Outside water and lighting.\nWe are advised that there is a newly installed sewage treatment plant, mains electricity, log burner and calor gas connected to the property.\nAs taken from the Gov.uk website we are advised the property is in Band D- again we would recommend this is verified during pre-contract enquiries.\n', "No code"),
